import React, { useState, useEffect } from 'react';
import axios from 'axios';

const App = () => {
  const [data, setData] = useState([]);
  const sheetId = '78425244'; // Replace with your actual sheet ID

  useEffect(() => {
    const fetchData = async () => {
      try {
        if (!sheetId) {
          console.error('No sheet id provided');
          return;
        }

        const response = await axios.get(`http://localhost:3001/sendpostrequest`);

        setData(response.data.data);
        console.log(response.data);
      } catch (error) {
        console.error('Error fetching data:', error.message);
      }
    };

    fetchData();
  }, [sheetId]);

  return (
    <div style={styles.container}>
      <h1 style={styles.heading}>Tigersheet API Example</h1>
      <ul style={styles.list}>
        {Array.isArray(data) && data.length > 0 ? (
          data.map(item => (
            <li key={item.record_id} style={styles.listItem}>
              <p style={styles.itemText}>Username: {item.username}</p>
              <p style={styles.itemText}>Password: {item.password}</p>
              <p style={styles.itemText}>Email: {item.email}</p>
              {/* <hr style={styles.hr} /> */}
            </li>
          ))
        ) : (
          <p style={styles.noData}>No data available</p>
        )}
      </ul>
    </div>
  );
};

const styles = {
  container: {
    fontFamily: 'Arial, sans-serif',
    maxWidth: '600px',
    margin: 'auto',
    padding: '20px',
  },
  heading: {
    fontSize: '24px',
    marginBottom: '20px',
  },
  list: {
    listStyle: 'none',
    padding: '0',
  },
  listItem: {
    marginBottom: '20px',
  },
  itemText: {
    margin: '0',
  },
  hr: {
    border: '0.5px solid #ccc',
  },
  noData: {
    fontStyle: 'italic',
    color: '#555',
  },
};

export default App;
